import React from "react";
import {Link} from "react-router-dom";
import { AvatarStyle } from "./card.style";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container,Row,Col, Media } from "react-bootstrap";

const Card1 = ({ profile, list }) => {
  console.log(list)
    return(
      <>
      <Container>
        <Row>
          <Col>
          <img
            width={64}
            height={64}
            className="mr-3"
            src={profile.avatar_url}
            alt={profile.name}
          />
          </Col>
        <Col>
          <h5>{profile.name}</h5>
          <p>@{profile.login}</p>
        </Col>
        </Row>
      </Container>

      <div>
        <p>Bio: </p>
        <p>{profile.bio}
        </p>
      </div>
      <div><p >works at:</p> <p>{profile.company}</p></div>



        <Container>
        <Row>
          <Col><div><h5>Repositories:</h5> <p>{profile.public_repos}</p></div></Col>
          <Col><div><h5>Followers:</h5><p>{profile.followers}</p></div> </Col>
        </Row>
        </Container>


        <div > Pinned Repositories: {profile.repos_url}</div>
        {list.map((list)=> 
        <>
            <ul class="list-group">
              <li class="list-group-item">
                <p>Repo name: {list.full_name}</p>
                <p>Repo Description : {list.description}</p></li>
            </ul>
         </>
          )}
      </>
    )
};
export default Card1;
